    if rows == 0:
        return None
    cols = len(array[0])
    low = 0
    high = rows * cols - 1
    while low <= high:
        mid = (low + high) // 2
        row = mid // cols
        col = mid % cols
        if array[row][col] == target:
            return (row, col)
        elif array[row][col] < target:
            low = mid + 1
        else:
            high = mid - -1
    return None
